import React, { useEffect } from 'react';
import s from './App.module.scss';
import Header from './components/Header/Header';
import Game from './components/Game/Game';
import { useDispatch } from 'react-redux';
import { getFrequency } from './Redux/thunks/frequencyThunks';
import { getMarkets } from './Redux/thunks/marketsThunks';
import { getHistory } from './Redux/thunks/historyThunks';
import { getLimits } from './Redux/thunks/limitsThunks';
import { useTimer } from 'react-timer-hook';

// ActiveNumbers ,LoderProcess

const App = () => {
  const dispatch = useDispatch();
  const expiryTimestamp = useSelector(selectTimer);
  const time = new Date();
  const timeOnSeconds = time.setSeconds(time.getSeconds() + expiryTimestamp);

  const loop = () => {
    setInterval(() => {
      dispatch(getHistory());
    }, 60000);
  };

  useEffect(() => {
    loop();
  }, []);

  useEffect(() => {
    dispatch(getLimits());
    dispatch(getFrequency());
    dispatch(getMarkets());
    dispatch(getHistory());
  }, []);

  const { seconds, minutes } = useTimer({
    expiryTimestamp: timeOnSeconds,
    onExpire: () => {
      console.log('asa' + seconds + '==' + minutes);
    },
  });

  return (
    <div className={s.app}>
      <Header />
      <Game />
    </div>
  );
};

export default App;
